import React from "react";
import { useSelector } from "react-redux";
import { getUsername } from "../ducks/session";
import {getBookings} from "../ducks/bookings";

function Home() {
  const stateUsername = useSelector(getUsername);
  const myBookings = useSelector(getBookings).filter(book => book.username === stateUsername);

  return (
    <div className="form">
      <h3>Welcome home, {stateUsername}!</h3>
        <p>Din/a bokningar: </p>
        {myBookings.map((book) => {
            return (<p key={book.date}>{`Datum ${book.date} klockan ${book.hour} `}</p>)
        })}
    </div>
  );
}
export default Home;
